/* VCD dumping functions */
MOD_mkCRT_TB1 & mkCRT_TB1_backing(tSimStateHdl simHdl)
{
  static MOD_mkCRT_TB1 *instance = NULL;
  if (instance == NULL)
  {
    vcd_set_backing_instance(simHdl, true);
    instance = new MOD_mkCRT_TB1(simHdl, "top", NULL);
    vcd_set_backing_instance(simHdl, false);
  }
  return *instance;
}
void MODEL_mkCRT_TB1::dump_VCD_defs()
{
  (mkCRT_TB1_instance->dump_VCD_defs)(vcd_depth(sim_hdl));
}
void MODEL_mkCRT_TB1::dump_VCD(tVCDDumpType dt)
{
  (mkCRT_TB1_instance->dump_VCD)(dt, vcd_depth(sim_hdl), mkCRT_TB1_backing(sim_hdl));
}
